import React from "react";
import {ReactComponent as EditIcon} from '../../assets/images/edit-icon.svg';
import {ReactComponent as BinIcon} from '../../assets/images/bin-icon.svg';

const IconButton = ({buttonType, onClick}) => {

    let iconButtonClassName = "icon-button";

  if (buttonType === "-edit") {
      iconButtonClassName += "edit";
return (
    <button className={iconButtonClassName} onClick={onClick}>{<EditIcon/>}</button>
)
  } else if (buttonType === "delete") {
    iconButtonClassName += "-delete";
    return (
        <button className={iconButtonClassName} onClick={onClick}>{<BinIcon/>}</button>
      )}
    }

export default IconButton;
